To pack and unpack an array of entities into an `ArrayBuffer`, you can use JavaScript's `DataView` to handle the binary data. Here's how you can implement the two functions:

### Pack Function

The `pack` function will take an array of entities and pack them into an `ArrayBuffer`.

```javascript
function packEntities(entities) {
    const numEntities = entities.length;
    const buffer = new ArrayBuffer(Math.ceil(numEntities * 7 / 8)); // 7 bits per entity
    const view = new DataView(buffer);

    let bitIndex = 0;
    let byteIndex = 0;
    let currentByte = 0;

    for (let i = 0; i < numEntities; i++) {
        const entity = entities[i];
        const id = entity.id & 0xF; // 4 bits
        const size = entity.size & 0x7; // 3 bits

        // Pack id and size into 7 bits
        const packedValue = (id << 3) | size;

        // Write the packed value to the buffer
        for (let j = 0; j < 7; j++) {
            if (bitIndex === 8) {
                view.setUint8(byteIndex, currentByte);
                byteIndex++;
                currentByte = 0;
                bitIndex = 0;
            }
            currentByte |= ((packedValue >> (6 - j)) & 1) << (7 - bitIndex);
            bitIndex++;
        }
    }

    // Write the last byte if there are remaining bits
    if (bitIndex > 0) {
        view.setUint8(byteIndex, currentByte);
    }

    return buffer;
}
```

### Unpack Function

The `unpack` function will take an `ArrayBuffer` and unpack it into an array of entities.

```javascript
function unpackEntities(buffer) {
    const view = new DataView(buffer);
    const numBytes = buffer.byteLength;
    const entities = [];

    let bitIndex = 0;
    let byteIndex = 0;
    let currentByte = view.getUint8(byteIndex);

    while (byteIndex < numBytes) {
        let packedValue = 0;

        // Read 7 bits
        for (let j = 0; j < 7; j++) {
            if (bitIndex === 8) {
                byteIndex++;
                if (byteIndex < numBytes) {
                    currentByte = view.getUint8(byteIndex);
                }
                bitIndex = 0;
            }
            packedValue |= ((currentByte >> (7 - bitIndex)) & 1) << (6 - j);
            bitIndex++;
        }

        // Unpack id and size from the 7 bits
        const id = (packedValue >> 3) & 0xF; // 4 bits
        const size = packedValue & 0x7; // 3 bits

        entities.push({ id, size });
    }

    return entities;
}
```

